import React from 'react'
import ExpenseItem from './expenseapp05/ExpenseItem'

const ExpenseApp05 = () => {
    const expenses = [
        {
            id: 'e1',
            title: 'Spiral Notebook',
            amount: 500,
            date: new Date(2023, 4, 14)
        },
        {
            id: 'e2',
            title: 'Scotch Tape',
            amount: 125,
            date: new Date(2023, 7, 20)
        },
        {
            id: 'e3',
            title: 'Marker Pens',
            amount: 300,
            date: new Date(2022, 4, 14)
        },
        {
            id: 'e4',
            title: 'Clips',
            amount: 100,
            date: new Date(2022, 8, 29)
        },
        {
            id: 'e5',
            title: 'Sharpie Pens',
            amount: 700,
            date: new Date(2019, 4, 14)
        }
    ]
    return (
        <div>
            <h1>Let's Get Started</h1>
            <ExpenseItem
                title={expenses[0].title}
                price={expenses[0].amount}
                date={expenses[0].date}
            />
            <ExpenseItem
                title={expenses[1].title}
                price={expenses[1].amount}
                date={expenses[1].date}
            />
            <ExpenseItem
                title={expenses[2].title}
                price={expenses[2].amount}
                date={expenses[2].date}
            />
            <ExpenseItem
                title={expenses[3].title}
                price={expenses[3].price}
                date={expenses[3].date}
            />
            <ExpenseItem
                title={expenses[4].title}
                price={expenses[4].price}
                date={expenses[4].date}
            />

        </div>
    )
}

export default ExpenseApp05
